import logo from "./logo.svg";
import "./App.css";

function Header(){
  return <header>
    <h1><a href="/">WEB</a></h1>
  </header>
}

function Nav(){
  return <ol>
  <li><a>html</a></li>
  <li><a>css</a></li>
  <li><a>js</a></li>
</ol>

}


function App() {


  return (
    <div>
      <Header></Header>
      <Nav></Nav>
    </div>
  );
}

export default App;
